INSERT INTO `informasi` (`id`, `judul`, `deskripsi`, `tanggal`, `gambar`, `jumlah_view`, `kategori`) VALUES
(1, 'MPLS 2025\r\n', 'Masa Pengenalan Lingkungan Satuan Pendidikan (MPLS) Ramah adalah kegiatan pertama bagi murid baru yang dilakukan oleh satuan pendidikan untuk menumbuhkan dan memperkuat karakter serta profil lulusan melalui pengenalan warga, kurikulum, dan lingkungan yang dirancang dengan memuliakan dan menghormati hak anak melalui pemberian pengalaman belajar yang berkesadaran, bermakna, dan menggembirakan.', '2025-07-15', 'banner-mpls-2025.png', 2, NULL),
(2, 'Tes Kemampuan Akademik', 'Dalam rangka memenuhi mandat konstitusional untuk menyediakan pendidikan bermutu bagi seluruh warga negara tanpa diskriminasi, Kemendikdasmen melalui Badan Standar, Kurikulum, dan Asesmen Pendidikan (BSKAP) menetapkan Peraturan Menteri Pendidikan Dasar dan Menengah Nomor 9 Tahun 2025 tentang Tes Kemampuan Akademik (TKA). ', '2025-07-09', 'Tes-Kemampuan-Akademik.png', 2, NULL),
(3, 'AI dan Koding di Tahun Ajaran 2005/2006', '“Untuk tahun ajaran 2005/2006, AI dan Koding masih menjadi mata pelajaran pilihan, bukan mata pelajaran wajib.”\r\nAbdul Mu’ti\r\nMendikdasmen\r\nDisampaikan saat menghadiri peluncuran Google Akademi dan Gemini Academy di Jakarta pada Rabu (7/5/2025).\r\n\r\n', '2025-05-27', 'Abdul-Muti1.png', 1, NULL),
(4, 'Pengelolaan E-Ijazah Diperpanjang', 'Berdasarkan hasil Rapata Koordinasi Pengelolaan Ijazah oleh Dotjen PAUD Dasmen secara daring dengan nomor surat undangan 5406/C1/HK.08/2025 pada Senin, 30 jUni 2025 maka pengelolaan E-Ijazah diperpanjnag sampai tanggal 11 Juli 2025 untuk jenjang Dasar dan Menengah (SD-SMA termasuk kesetaraan).\r\nMohon kepada Satuan Pendidikan dan Dinas Pendidikan dapat memanfaatkan waktu ini  untuk segera melakukan pengajuan dan perbaikan ijazah yang mengalami kendala sebelumnya.', '2025-06-19', 'Pengelolaan-Ijazah.png', 2, NULL),
(5, 'Kembali Mendapatkan Predikat INFORMATIF dari Kemendikdasmen', 'Pada acara pemberian Penghargaan Keterbukaan Informasi Publik di Kemendikdasmen pada hari Selasa, 3 Juni tahun 2025, BBPMP Provinsi Jawa Barat kembali meraih penghargaan tertinggi INFORMATIF yang ke-2 kalinya yang diserahkan oleh Sekretaris Jenderal Kemendikdasmen, Suharti dan diterima oleh Kepala BBPMP Provinsi Jawa Barat, Komalasari, S.Pd., M.Pd.', '2025-06-26', 'Penjaminan-Mutu-Pendidikan-Jawa-Barat.png', 11, NULL),
(10, 'coba coba', 'ini hanya percobaan dan bukan konten asli', '2025-08-07', '1754542964_no5.png', 2, NULL);

